Ext.data.JsonP['Dashboard_4.8.2_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.8.2  - 19 July 2016</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46254386\" class=\"content\">\n                        <h1>Dashboard 4.8.2  - 19 July 2016</h1>\n    <p>Dashboard 4.8.2 is a patch release, which includes several bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-46254386_Dashboard4.8.2ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed bug where a member&apos;s role in the organization could not be changed when all seats in the organization were in use    </p>\n</li><li class=\" \">    <p>Fixed bug where Pro plan organizations could not query analytics data for more than 30 days    </p>\n</li><li class=\" \">    <p>Fixed bug where trial organizations attempting to use custom date range selection for analytics data would receive an &quot;Invalid Date&quot; error message    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46254386\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.8.2 Release Note"});